import React from "react";

import {Text,StyleSheet,View} from "react-native";

const Spacer = ({children}) => {
    return (
        <View style={styles.spacer}>
            {children}
        </View>
    )
}

const styles = StyleSheet.create({
    spacer : {
        margin : 15
    }
})

export default Spacer;
